Create a JavaScript program that allows users to draw on an HTML5 canvas
model
```html
<!DOCTYPE html>
<html>
  <head>
    <script>
      const canvas = document.getElementById('myCanvas');
      const ctx = canvas.getContext('2d');

      let drawing = false;
      let x = 0;
      let y = 0;

      function draw() {
        if (drawing) {
          ctx.beginPath();
          ctx.ellipse(x, y, 50, 50, 'rgba(255, 0, 0, 0.5);
          ctx.stroke();
        }
        requestAnimationFrame(draw);
      }

      function startDrawing() {
        drawing = true;
        draw();
      }

      document.addEventListener('click', startDrawing);
    </script>
  </head>

  <body>
    <canvas id="myCanvas" width="500" height="500"></canvas>
  </body>

  <script>
    startDrawing();
  </script>
</html>
```

**Explanation:**

* The code creates a variable `drawing` to track whether the user is drawing.
* If the user is drawing, the code creates a path using the `ellipse()` function.
* The `x` and `y` variables store the mouse position.
* The `startDrawing()` function is called when the user clicks the canvas.
* The `addEventListener()` function listens for a click event and calls `startDrawing()` when the user clicks.
* The `draw()` function is called repeatedly to update the canvas.

**To use the code:**

1. Copy the code above into a JavaScript file, for example, `drawing.js`.
2. Create an HTML file, for example, `index.html`.
3. Open `index.html` in a web browser.
4. Click on the canvas to start drawing.

**Notes:**

* You may need to include the `canvas` and `path` scripts in your HTML file.
* You can customize the color of the line by changing the `rgba()` values in the `ellipse()` function.
* You can change the canvas size by modifying the `width` and `height` attributes in the HTML code.
* You can add other drawing functions,

